import './App.css';
import 'bootstrap/dist/css/bootstrap.css';
import Topnavbar from './TopNavbar';
import {
  BrowserRouter as Router,
  Routes,
  Route} from "react-router-dom";
import AnggotaIndex from './Anggota/Index';
import Shu from './Shu';

function App() {
  return (
    <div className="hk-wrapper" data-layout="navbar" data-layout-style="default" data-menu="light" data-footer="simple">
      <div id="wrapper">
        <Router>
          <Topnavbar />
          <Routes>
              <Route path="/anggota" element={<AnggotaIndex />} />
              <Route path="/shu" element={<Shu/>} />
          </Routes>
        </Router>
      </div>
    </div>
  );
}

export default App;
